INSERT INTO `t_article` VALUES ('1147039741237400', null, null, '2020-01-17 17:44:11', null, null, '2020-01-17 17:44:11', null, null, 'news', '<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	今天钢价平稳运行，市场价格波动较小，期货走弱，市场成交清淡。市场维持弱势震荡模式，如上图所示，钢铁相关品种指数平稳，让人对市场的走势感到无聊，没有涨价预期的推动，成交情况也难以令人满意。<img src=\"/attached/image/20200117/20200117174408_593.jpg\" alt=\"\" />\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	今日期货市场黑色板块除焦炭外，普遍稳中趋弱运行。\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	<br />\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	具体来看，螺纹跌1.43%至3731，铁矿跌1.15%至643，热卷跌1.5%至3687，焦煤跌0.18%至1368，焦炭涨2.21%至2147.5。目前期货仍处于震荡区间，没有明显的方向，预计震荡走势仍将延续。\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	期钢价格平稳，导致钢坯等品种出货量较为平淡。从主要数据来看，唐山钢坯库存量减少，但减少幅度比较小。唐山地区主要钢坯库存数据如下：1.象屿正丰库存量为13.5万吨，较昨日减少0.22万吨；2.海翼宏润库存量为18.44万吨，较昨日减少0.58万吨;3.物产震翔库存量为2.93万吨，较昨日减少0.1万吨。三个主要库存合计为34.87万吨，较昨日库存减少0.9万吨。\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	现货价格平稳，出货量平淡，但更新数据显示，需求端仍保持复苏趋势。前4个月，我国机电产品出口2.97万亿元，增长4.5%，占出口总值的58.6%。其中，电器及电子产品出口1.33万亿元，增长4.9%；<a href=\"https://www.bmlink.com/supply/jixieshebei\" target=\"_blank\">机械设备</a>8905.6亿元，增长3.9%。此外，钢材出口2335万吨，增加8.3%；汽车34万辆，增加1.1%。\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	出口数据增长，需求稳中上扬，随着采暖季的结束，钢厂产量也开始提升。这种需求增长、产量也增长的格局，导致钢价处于震荡中，没有大的波动。\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	随着各地采暖季的结束，4月起钢厂纷纷开始复产，二季度高炉开工率将回升。同时，由于钢厂目前利润较好，生产积极性很高。\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	如果考虑到各地错峰生产的要求，从目前的执行力度来看并不是很大。加之目前钢厂检修计划情况来看，基本都处于“搁置”或“延迟”的状态。\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	据不完全统计，4月以来，计划检修或已经在检修的钢厂只有8家。其中，包头亚新钢厂自4月17日起对全线停产，检修时间长达50天，预计影响建材产量40万吨左右。整体上看，5月份，多数钢厂检修结束，预计5月份产量仍将居于高位。\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	综合来看，目前出口数据保持平稳增长，说明需求表现稳中有升，但也应该看到，但钢厂产能大增，导致钢材供应趋于宽松，需求端能不能消化如此高的产量，市场对此仍存疑问，这也是导致钢价偏弱震荡，但又不能跌下来的重要原因。预计明日钢价小幅下跌。\n</p>\n<p style=\"font-family:微软雅黑;text-indent:2em;color:#333333;font-size:14px;\">\n	（本文来源：中钢网，侵删）\n</p>\n<p>\n	<br />\n</p>', 'admin', '0', '1146982279109800.jpg', '0', null, '0', '今天钢价平稳运行，市场价格波动较小，期货走弱，市场成交清淡。市场维持弱势震荡模式，如上图所示，钢铁相关品种指数平稳，让人对市场的走势感到无聊，没有涨价预期的推动，成交情况也难以令人满意。', '注意！吨钢利润近800！钢厂检修潮结束，钢价要跌了！', '0', null, null, null, null, null, null, null, null, null, null, null, '2020-01-17 17:44:11', '0', '0', '0', null, null);
