INSERT INTO `t_article` VALUES ('1147497624692200', null, null, '2020-01-18 04:59:30', null, null, '2020-01-18 04:59:30', null, null, 'news', '<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\">在国新办召开的上半年工业通信业经济运行情况新闻发布会上，中国工业和信息化部原材料工业司司长陈燕海称，力图通过联合重组、淘汰落后产能，实现大幅度减少钢铁企业数量，将现在约800家钢企大幅减少至约200家。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 而针对外界的争论，工信部新闻发言人朱宏任否认了中国经济将“二次探底”的说法，他称中国工业增速全年将超过11%。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 钢企面临大规模重组</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 根据不完全统计,目前我国有上千家钢企,其中上规模的大中型钢企有70多家。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 6月下旬,国务院指出，要培育形成6~7</span><a href=\"https://www.bmlink.com/supply/jiaju\" target=\"_blank\">家具</a><span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\">有较强实力的特大型钢企集团,力争到2015年国内排名前10位的钢企产量占全国产量的比例从2009年的44%提高到60%以上。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 《每日经济新闻》记者获悉，工业和信息化部上周出台钢铁行业生产经营规范条件,对钢企在环保、能耗、生产规模等方面做了一系列准入规定,其中，将钢厂生产规模的准入</span><a href=\"https://www.bmlink.com/supply/men\" target=\"_blank\">门</a><span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\">槛设定为——2009年普钢企业粗钢产量100万吨及以上，特钢企业30万吨及以上，且合金钢比大于60%(不含合金钢比100%的高速钢、工模具钢等专业化企业)。此举被视为治理中国钢铁业产能增长过快和管理不完善的一记重拳。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 在昨日，新闻发布会上，陈燕海称,通过执行规范条件,力图进一步规范钢铁行业的生产经营秩序,按照生产经营规范所提出来的质量、环保、能耗、装备、安全、企业责任以及生产规模进行规范,同时大幅度减少钢企。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 规范条件的执行方面,工信部规范条件将作为有关部门核准和备案项目的一个依据,以控制钢铁业投资和产能过快增长;同时将该规范条件作为合理配置矿石资源的依据;并积极引导银行的贷款和社会投资的投向和投量。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 否认经济“二次探底”</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 对于中国经济二次是否探底的争论一直在进行之中。在昨天的新闻发布会上，工业和信息化部新闻发言人朱宏任就此表示，工业增速的回落既有去年基数影响，也是主动调控的结果，因而中国经济不存在“二次探底”的可能。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 据昨日工信部公布，6月份，规模以上工业增加值同比增长13.7%，增速环比回落2.8个百分点，是今年以来月度增速回落幅度较大的一个月。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> “增速回落不仅是适度的，也有利于促进工业结构调整和发展方式的转变，有利于保持工业经济平稳较快地发展。”</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 朱宏任表示，稳定宏观政策、巩固和发展经济继续回升向好的形势仍然是下半年经济工作的主要基调。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 下半年经济政策的主要取向还是保持经济政策的连续性和稳定性，同时也增加宏观调控的针对性和灵活性，区分轻重缓急，防止各种不利的因素产生叠加效应。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 朱宏任具体分析称，考虑去年基数因素，工业经济运行态势基本平稳。去年一季度规模以上工业增加值增速为5.1%，二季度增速为9.1%；相应今年一季度增速为19.6%，二季度为15.9%。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 从月度走势看，受去年上半年增速逐月走高的影响，今年6月份增速从头两个月的20.7%逐月回落到为13.7%，其中6月份增速比5月份回落2.8个百分点，是今年以来回落幅度较大的一个月。基数提高对今年6月份增速回落影响占65%左右。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 从宏观调控的效果来看，朱宏任认为，政策因素对抑制部分高耗能行业过快增长势头产生了积极作用。上半年六大高耗能行业增加值同比增长17.2%，比一季度减缓2.4个百分点。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 工业增速全年超过11%</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 不过，朱宏任指出，尽管经济形势总体回升向好，但是经济运行中面临的困难、问题还不少。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 其一，能源、原材料价格在上半年出现了较大幅度的波动；其二，用工压力特别是工资成本的压力增加表现得比较突出。今年以来长三角、珠三角等沿海地区劳动力工资水平普遍上调了20%~25%；其三，小企业反映的融资难问题与去年相比明显增加，另外有一些以外</span><a href=\"https://www.bmlink.com/supply/xiao\" target=\"_blank\">销</a><span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\">为主的加工制造企业特别是劳动密集型企业对宏观环境的变化更趋敏感，现在接大单、长单都心有余悸。其四，虽然外需正在逐步恢复，但世界经济复苏的基础还相当脆弱，快速回升的出口形势具有不确定性，特别是在下半年这个情况表现得更为突出。</span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> </span><br />\n<span style=\"color:#333333;font-family:微软雅黑;font-size:14px;\"> 从全年运行趋势看，由于受去年全年“前低后高”走势影响，预计下半年工业增速将有一定程度回落，全年增速可超过年初提出的11%预期目标。</span><img src=\"/attached/image/20200117/20200117174314_505.jpg\" alt=\"\" />', 'admin', '0', '1188053867423600.jpg', '0', null, '0', '在国新办召开的上半年工业通信业经济运行情况新闻发布会上，中国工业和信息化部原材料工业司司长陈燕海称，力图通过联合重组、淘汰落后产能，实现大幅度减少钢铁企业数量，将现在约800家钢企大幅减少至约200家。　', '钢企将从800家压缩到200家', '0', null, null, null, null, null, null, null, null, null, null, null, '2020-01-18 04:59:30', '0', '0', '0', null, null);
INSERT INTO `t_article` VALUES ('1148186250531700', null, null, '2020-01-18 04:59:14', null, null, '2020-01-18 04:59:14', null, null, 'news', '<span style=\"color:#333333;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\">1月11日上午，中国钢铁工业协会六届一次会员大会在京召开。经过投票，选举了第六届常务理事和协会负责人，沙钢集团董事长沈彬、宝武集团董事长陈德荣、鞍钢集团董事长谭成旭、首钢集团董事长张功焰、河钢集团董事长于勇任中国钢铁工业协会会长，何文波任执行会长（常务副会长）兼秘书长。</span><img src=\"/attached/image/20200117/20200117175419_115.jpg\" alt=\"\" /> <p align=\"left\" style=\"text-indent:28px;color:#333333;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\">\n	中国钢铁工业协会第五届理事会<a name=\"_GoBack\"></a>会长高祥明在会上作工作报告，分析当前面临的形势，提出2020年重点工作建议。\n	</p>\n<p align=\"left\" style=\"text-indent:28px;color:#333333;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\">\n	首先，高祥明会长回顾了过去五年行业改革发展取得的成绩，过去的五年，是中国钢铁行业深入推进供给侧结构性改革，加快结果调整和转型升级，为行业高质量发展奠定基础的五年。钢铁行业总体运行平稳、稳中向好，但同时稳中也有忧，尤其是2019年出现的<span style=\"font-weight:700;\">产能释放快</span>、<span style=\"font-weight:700;\">铁矿石价格大幅上涨</span>、<span style=\"font-weight:700;\">环保压力加大</span>等问题亟须各方面关注、解决。接下来介绍五年来第五届理事会及协会开展的主要工作，配合政府部门推动供给侧结构性改革，努力巩固去产能成果；持续推进对标挖潜、降本增效、去杠杆；积极参与政策法规和规划的制定，反应企业诉求等。最后，就2020年行业发展形势和重点工作任务做了详细介绍，高祥明强调，要建立实施钢铁原材料保障战略，一是<span style=\"font-weight:700;\">加强信息披露，强化市场监督</span>；二是<span style=\"font-weight:700;\">研究改进铁矿石等大宗商品定价机制</span>；三是<span style=\"font-weight:700;\">多措并举，拓宽铁矿石供应渠道</span>。坚持把政治建设摆在首位，全面加强党的建设，用党建引领钢铁行业克难攻坚，实现高质量发展。\n</p>\n<p align=\"left\" style=\"text-indent:28px;color:#333333;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"><br />\n	</p>\n<p align=\"left\" style=\"text-indent:28px;color:#333333;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\">\n	<span style=\"color:#777777;font-family:\" font-size:13px;background-color:#ffffff;\"=\"\">【免责声明】以上文章转载自互联网，转载目的在于传递更多信息，并不代表本网赞同其观点和对其真实性负责；如稿件版权单位或个人不愿在本网发布，请在两周内来电或来函与本网联系。</span> \n</p>', 'admin', '0', '1188039051680500.jpg', '0', null, '0', '中国钢铁工业协会六届一次会员大会在京召开', '中国钢铁工业协会六届一次会员大会在京召开', '0', null, null, null, null, null, null, null, null, null, null, null, '2020-01-18 04:59:14', '0', '0', '0', null, null);
INSERT INTO `t_article` VALUES ('1148609369756400', null, null, '2020-01-17 18:02:03', null, null, '2020-01-17 18:02:03', null, null, 'about', '', 'admin', '0', '', '0', null, '0', '国资委党委委员、秘书长彭华岗在1月15日的国资委发布会上表示，2019年末，央企平均资产负债率为65.1%，比年初下降0.6个百分点。有64家企业资产负债率较年初下降，冶金、电力、矿业、建筑等行业资产负债率下降超过1个百分点。2019年末，央企带息负债比率38.2%，同比下降1.1个百分点，流动比率和速动比率均有所提升，整体偿债能力保持稳定。', '国资委：2019年冶金等行业负债率明显下降', '0', '0', null, null, null, null, null, null, null, null, null, null, '2020-01-17 18:02:03', '0', '0', '0', null, null);
INSERT INTO `t_article` VALUES ('1148654244073700', null, null, '2020-01-17 18:02:48', null, null, '2020-01-17 18:02:48', null, null, 'about', '', 'admin', '0', '', '0', null, '0', '为贯彻落实党中央、国务院关于深化供给侧结构性改革的决策部署，不断夯实煤矿安全生产基础，加快构建煤炭产供储销体系，提升煤炭安全稳定供应保障能力，国家发展改革委、国家能源局、应急管理部、国家煤矿安监局对《煤矿安全改造专项管理办法》进行了修订。近日上述部门将修订后的《煤矿安全改造中央预算内投资专项管理办法》已印发。', '发改委等四部门修订印发《煤矿安全改造中央预算内投资专项管理办法》', '0', '0', null, null, null, null, null, null, null, null, null, null, '2020-01-17 18:02:48', '0', '0', '0', null, null);
INSERT INTO `t_article` VALUES ('1149537529849700', null, null, '2020-01-17 18:17:31', null, null, '2020-01-17 18:17:31', null, null, 'active', '', 'admin', '0', '', '0', null, '0', '　据国家统计局统计，12月份我国粗钢、生铁和钢材产量分别为8427万吨、6706万吨和10433万吨，同比分别增长11.6%、增长6%和增长11.3%；日均产量分别为271.84万吨、216.32万吨和336.55万吨，日均环比分别增长1.6%、增长0.2% 和下降2.9%。', '统计局：12月粗钢产量同比增长11.6%', '0', '0', null, null, null, null, null, null, null, null, null, null, '2020-01-17 18:17:31', '0', '0', '0', null, null);
INSERT INTO `t_article` VALUES ('1149577166183300', null, null, '2020-01-17 18:18:11', null, null, '2020-01-17 18:18:11', null, null, 'active', '', 'admin', '0', '', '0', null, '0', '　　国家统计局1月17日发布的最新数据显示，2019年12月份，全国原煤产量33174万吨，同比增长2.4%，增速较上月收窄2.1个百分点；环比减少232万吨，下降0.69%。\n　　12月份，全国日均原煤产量1070万吨，环比减少44万吨。2019年1-12月份全国原煤产量374552万吨，同比增长4.2%，增速较1-11月收窄0.3个百分点。', '2019年全国原煤产量374552万吨', '0', '0', null, null, null, null, null, null, null, null, null, null, '2020-01-17 18:18:11', '0', '0', '0', null, null);
INSERT INTO `t_article` VALUES ('1149619222864500', null, null, '2020-01-17 18:18:53', null, null, '2020-01-17 18:18:53', null, null, 'active', '', 'admin', '0', '', '0', null, '0', '　　力拓2019年第四季度氧化铝产量达203万吨，同比增长0.6%。2019年第四季度矿铜产出13.8万吨，市场预期13.95万吨。2019年第四季度皮尔巴拉（Plibara）铁矿石产出8360万吨，市场预期8650万吨。2019年第四季度皮尔巴拉（Plibara）铁矿石装运量达8680万吨，市场预期8670万吨。力拓预计2020年氧化铝产量780-820万吨。力拓预计2020年皮尔巴拉（Plibara）铁矿石装运量达3.3-3.43亿吨。', '力拓预计2020年皮尔巴拉铁矿石装运量达3.3-3.43亿吨', '0', '0', null, null, null, null, null, null, null, null, null, null, '2020-01-17 18:18:53', '0', '0', '0', null, null);
INSERT INTO `t_article` VALUES ('1149741950632000', null, null, '2020-01-18 04:59:50', null, null, '2020-01-18 04:59:50', null, null, 'dynamic', '<span style=\"color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\">&nbsp; &nbsp; 1月9日，中国二十冶集团承建联峰钢铁炼钢三厂6、7号转炉工程成功烘炉。</span> <div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\">\n	该工程施工内容主要包括转炉本体更换，烟道系统更换，气化系统更换，一次除尘更换，氧枪系统更换，平台加固改造，一机8流连铸机除大包系统保留外全部更换。 据统计，此次大修项目共计707个子项，其中设备检修项目697项，技改项目10项。\n	</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\">\n	施工伊始，中国二十冶集团项目部从组织机构设置、检修项目落实、时间节点安排、人员机具调配、施工方案制定等，提前进行了周密的部署和安排，按照精确到每个小时的进度计划圆满完成了施工任务，印证了中国二十冶集团“冶金建设国家队”的实力担当\n</div>', 'admin', '0', '1188074835784700.jpg', '0', null, '0', '中国二十冶联峰钢铁炼钢三厂成功烘炉', '中国二十冶联峰钢铁炼钢三厂成功烘炉', '0', null, null, null, null, null, null, null, null, null, null, null, '2020-01-18 04:59:50', '0', '0', '0', null, null);
INSERT INTO `t_article` VALUES ('1149788836300700', null, null, '2020-01-18 04:59:42', null, null, '2020-01-18 04:59:42', null, null, 'dynamic', '<p style=\"color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <b> 中国废钢铁应用协会信息统计部</b> \n	</p>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">上周，国内废钢主流市场趋稳，废钢场地资源减少，商家送货积极性不高，钢厂到货一般。</span> \n		</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">重点钢企废钢平均采购价格与前一周相比，重型废钢价格上调5元/吨，中型废钢价格上调4元/吨，统料废钢价格上调2元/吨。</span> \n	</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">临近春节，钢材需求萎缩，市场成交偏弱，部分电炉钢厂陆续开始停产检修，废钢资源紧张的局面有所缓解。但受南方阴雨北方降雪天气影响，废钢运输成本增加，市场货源稀少，长流程钢厂废钢仍在补库阶段，但钢厂到货不及预期。预计短期内废钢主流市场将稳定运行，窄幅调整。</span> \n		</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">华东地区废钢市场平稳运行，市场资源较为紧张。1月份，宝钢重型废钢采购价为2000元/吨；南钢重型废钢采购价为2680元/吨；沙钢重型废钢采购价为2780元/吨；兴澄特钢精炉料采购价为2770元/吨；马钢重型废钢采购价为2690元/吨；铜陵富鑫重型废钢采购价为2840元/吨，上调40元/吨；方大特钢重型废钢采购价为2910元/吨，上调60元/吨；石横特钢重型废钢采购价为2750元/吨，上调30元/吨；西王金属重型废钢采购价为2882元/吨。</span> \n	</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">华中地区废钢市场稳中窄幅调整，部分钢厂小幅拉涨价格吸收货源。安钢重型废钢采购价为2740元/吨；舞钢重型废钢采购价为2720元/吨，上调30元/吨；华菱湘钢一级料采购价为2560元/吨、上调30元/吨、衡钢重型废钢采购价为2700元/吨、下调20元/吨，涟钢一级料基价为2330元/吨；武钢重型废钢采购价为2800元/吨。</span> \n		</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">华南地区废钢市场弱势运行，个别钢厂小幅下调采购价格。三钢闽光重型废钢采购价为2700元/吨，下调50元/吨；柳钢厚剪采购价为2550元/吨；韶钢重型废钢采购价为2893元/吨。</span> \n	</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">西南地区废钢市场平稳运行，资源偏紧。攀长钢重型废钢采购价为2650元/吨；首钢水钢钢铁炉料采购价为2670元/吨；昆钢重型废钢采购价为2700元/吨。</span> \n		</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">西北地区废钢市场持稳，流通资源减少，废钢加工及运输难度增大。西宁特钢重型废钢采购价为2610元/吨，上调40元/吨；酒钢重型废钢采购价为2560元/吨。</span> \n	</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">东北地区废钢市场弱势运行，成交清淡。凌钢重型废钢采购价为2880元/吨，本钢重型废钢采购价为2859元/吨，鞍钢重型废钢采购价为2830元/吨。</span> \n		</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">华北地区废钢货源偏紧，钢厂到货不乐观。天津钢管重型废钢采购价为2880元/吨，上调30元/吨；首钢迁钢重型废钢采购价为2890元/吨；包钢重型2类废钢采购价为2710元/吨；太钢重型废钢采购价为2630元/吨。</span> \n	</div>\n<div style=\"margin:0px;padding:0px;color:#333333;font-family:\" font-size:15px;background-color:#ffffff;\"=\"\"> <span style=\"line-height:normal;\">《中国冶金报》（2020年01月15日 &nbsp;06版六版）</span> \n		</div>', 'admin', '0', '1188065017782500.jpg', '0', null, '0', '', '国内废钢主流市场趋稳（1月4日~1月10日）', '0', null, null, null, null, null, null, null, null, null, null, null, '2020-01-18 04:59:42', '0', '0', '0', null, null);
